import React from 'react'; 
import './ChartBar.css'; 

const ChartBar = (props) => {
let barFillHeigt = '0%'; 
if (props.maxValue > 0){
    barFillHeigt = Math.round((props.value / props.maxValue) * 100) + '%'; 
}

    return (
    <div className = "chart-bar">
        <div 
        className = "chart-bar__inner"> 
        <div className = "chart-bar__fill" style ={{height: barFillHeigt}}>
        </div>
        </div>
        <div className = "chart-bar__label">{props.lable} </div>
      </div>
    );
};

export default ChartBar;
